	public   PrivateKey getPrivate(String path) throws ParserConfigurationException, SAXException, IOException, NoSuchAlgorithmException, InvalidKeySpecException{
		File file = new File(path+"/WEB-INF/key/privateKey.xml");  
		DocumentBuilderFactory dbf = DocumentBuilderFactory.newInstance();  
		DocumentBuilder db = dbf.newDocumentBuilder();  
		Document doc = db.parse(file);  
		doc.getDocumentElement().normalize();  
		NodeList nodeList = doc.getElementsByTagName("Modulus");  
		Node modulus = nodeList.item(0);  
		NodeList nodeList1 = doc.getElementsByTagName("D");  
		Node d = nodeList1.item(0); 
		BigInteger modulusVal = new BigInteger(1,Base64.getDecoder().decode(modulus.getTextContent().trim()));
		BigInteger dVal = new BigInteger(1,Base64.getDecoder().decode(d.getTextContent().trim()));
		RSAPrivateKeySpec privSpec = new RSAPrivateKeySpec(modulusVal, dVal);
		KeyFactory kf = KeyFactory.getInstance("RSA");
		PrivateKey privKey = kf.generatePrivate(privSpec);
		return privKey;
	 }
	
	public static String decryptAESData(String algorithm, String cipherText, SecretKey key,
		    IvParameterSpec iv) throws NoSuchPaddingException, NoSuchAlgorithmException,
		    InvalidAlgorithmParameterException, InvalidKeyException,
		    BadPaddingException, IllegalBlockSizeException {
		    
		    Cipher cipher = Cipher.getInstance(algorithm);
		    cipher.init(Cipher.DECRYPT_MODE, key, iv);
		    byte[] plainText = cipher.doFinal(cipherText.getBytes());
		    return new String(plainText);
		}
	
	public static String encryptAESData(String algorithm, String data, SecretKey key,
		    IvParameterSpec iv) throws NoSuchPaddingException, NoSuchAlgorithmException,
		    InvalidAlgorithmParameterException, InvalidKeyException,
		    BadPaddingException, IllegalBlockSizeException {
		    
		    Cipher cipher = Cipher.getInstance(algorithm);
		    cipher.init(Cipher.ENCRYPT_MODE, key, iv);
		    byte[] encrypted = cipher.doFinal(data.getBytes());
		    String encoded = Base64.getEncoder().encodeToString(encrypted);
		    System.out.println(encoded);
	        return encoded;
		}
	
